import Fundo from "./Fundo";
export default function fundos({ children: data }) {
  const fundos = data.investments;
  const reports = data.reports;
  return (
    <div className="border p-2">
      {fundos.map((item) => {
        return <Fundo>{item}</Fundo>;
      })}
    </div>
  );
}
